import { combineReducers } from 'redux'; 
import { userSettings } from 'store/userSettings/userSetttingsReducer';
import { dataSet } from 'store/dataSet/dataSetReducer';

export const appReducer = combineReducers({
    dataSet,
    userSettings,
});
